import React from 'react';
import './LightIntensity.css';

const LightIntensity = ({ lightLevel }) => {
  // –¶–≤–µ—Ç–æ–≤–∞—è –ø–∞–ª–∏—Ç—Ä–∞ –≤–¥–æ—Ö–Ω–æ–≤–ª–µ–Ω–∞ –ª–µ—Å–Ω–æ–π —ç–∫–æ—Å–∏—Å—Ç–µ–º–æ–π
  const colors = {
    dark: '#3A5C40',        // –¢–µ–º–Ω–æ-—Ö–≤–æ–π–Ω—ã–π (–Ω–µ–¥–æ—Å—Ç–∞—Ç–æ–∫ —Å–≤–µ—Ç–∞)
    low: '#5D8C5A',         // –ú–æ–ª–æ–¥–∞—è –ª–∏—Å—Ç–≤–∞
    ideal: '#7CB45D',       // –°–æ—á–Ω–∞—è –∑–µ–ª–µ–Ω—å
    high: '#F0A830',        // –°–æ–ª–Ω–µ—á–Ω—ã–π –æ—Ä–µ–æ–ª
    danger: '#E05038',      // –û—Å–µ–Ω–Ω–∏–π –∫—Ä–∞—Å–Ω—ã–π
    textDark: '#1E3B23',
    textLight: '#F0F7E6',
    moss: '#8AAE92',
    fern: '#6B8C42'
  };

  const getLightColor = (light) => {
    if (light === null) return colors.textDark;
    if (light < 2000) return colors.dark;
    if (light < 10000) return colors.low;
    if (light < 30000) return colors.ideal;
    if (light < 50000) return colors.high;
    return colors.danger;
  };

  const getBackground = () => {
    return `linear-gradient(135deg, ${colors.fern}15 0%, ${colors.moss}15 100%)`;
  };

  const getPercentage = (light) => {
    if (!light) return 0;
    return Math.min(100, (light / 50000) * 100);
  };

  return (
    <div className="light-card">
      <div className="light-header">
        <h1 className="light-title">
          <span className="icon">üåø</span> –§–æ—Ç–æ—Å–∏–Ω—Ç–µ–∑ 
        </h1>
        <div className="light-icons">
          <span className="icon">üå≤</span>
          <span className="icon">‚òÄÔ∏è</span>
          <span className="icon">üçÉ</span>
        </div>
      </div>

      <div className="light-display">
        <div className="light-value" style={{ color: getLightColor(lightLevel) }}>
          {lightLevel !== null ? lightLevel.toLocaleString() : '--'}
          <span className="light-unit">lux</span>
        </div>
        <div className="light-scale">
          <span style={{ color: colors.moss }}>0</span>
          <div className="scale-bar">
            <div 
              className="scale-progress" 
              style={{
                width: `${getPercentage(lightLevel)}%`,
                background: `linear-gradient(90deg, 
                  ${getLightColor(lightLevel)} 0%, 
                  ${getLightColor(lightLevel)}80 100%)`
              }}
            />
          </div>
          <span style={{ color: colors.danger }}>50k</span>
        </div>
      </div>

      <div className="light-footer">
        {lightLevel !== null && (
          <div className={`status-message ${
            lightLevel < 2000 ? 'status-dark' :
            lightLevel < 10000 ? 'status-low' :
            lightLevel < 30000 ? 'status-ideal' :
            lightLevel < 50000 ? 'status-high' : 'status-danger'
          }`}>
            {lightLevel < 2000 ? (
              <>üåë  –°–ª–∏—à–∫–æ–º —Ç–µ–º–Ω–æ –¥–ª—è —Ä–∞—Å—Ç–µ–Ω–∏–π</>
            ) : lightLevel < 10000 ? (
              <>üå•Ô∏è –ù–∏–∑–∫–∞—è –æ—Å–≤–µ—â–µ–Ω–Ω–æ—Å—Ç—å</>
            ) : lightLevel < 30000 ? (
              <>üåø –ò–¥–µ–∞–ª—å–Ω–æ –¥–ª—è —Ä–æ—Å—Ç–∞</>
            ) : lightLevel < 50000 ? (
              <>‚ö†Ô∏è –Ø—Ä–∫–æ –¥–ª—è —Ç–µ–Ω–µ–ª—é–±–æ–≤</>
            ) : (
              <>üî• –û–∂–æ–≥ –ª–∏—Å—Ç—å–µ–≤</>
            )}
          </div>
        )}
      </div>
      
      <div className="leaf-decoration">üçÇ</div>
    </div>
  );
};

export default LightIntensity;
